            return {"conemail":"","conname":""}
        })
    }

  return (
    <>
        <div >
            <form action='' encType='multipart/html' >
                    <label>Email:</label>
                    <input type='email' name='conemail'></input>
                    <label>Name:</label>
                    <input type='text' name='conname'></input>
                    <label>Mobile Number:</label>
                    <input type='number' name='connumber'></input>
                    <label>Message:</label>
                    <textarea rows='5' cols='3'></textarea>
            </form>
        </div>
    </>
  )
}

